import express from "express";
import http from "http";
import WebSocket from "ws";

const app = express();

app.set("view engine", "pug");
app.set("views", __dirname + "/views");
app.use("/public", express.static(__dirname + "/public"));
app.get("/", (_, res) => res.render("home"));
app.get("/*", (_, res) => res.redirect("/"));

const handleListen = () => console.log(`Listening on http://localhost:3000`);

const server = http.createServer(app); // requestListenerÍ∞Ä ÏûàÏñ¥ÏïºÌï®.

const wss = new WebSocket.Server({ server }); //httpÏôÄ websocket ÏÑúÎ≤Ñ Î™®Îëê ÎèôÏûëÏãúÌÇ¥.ÌïÑÏàòÏÇ¨Ìï≠ÏùÄ ÏïÑÎãò.

//socketÏùÄ ÏÑúÎ≤ÑÏôÄ Î∏åÎùºÏö∞Ï†Ä ÏÇ¨Ïù¥Ïùò Ïó∞Í≤∞ÏùÑ ÏùòÎØ∏ÌïúÎã§.
wss.on("connection", (socket) => {
  console.log("Connected to browser");
  socket.on("close", () => {
    console.log("disconnected to server");
  });
  //Î∏åÎùºÏö∞Ï†ÄÎ°úÎ∂ÄÌÑ∞ Î©îÏÑ∏ÏßÄ(ÏöîÏ≤≠) Î∞õÏùå
  socket.on("message", (message) => {
    console.log(message.toString());
  });
  //Î∏åÎùºÏö∞Ï†Ä(ÌîÑÎ°†Ìä∏ÏóîÎìú)Ïóê Î©îÏÑ∏ÏßÄ(ÏöîÏ≤≠) Î≥¥ÎÉÑ
  socket.send("hello!!");
});

server.listen(3000, handleListen);
